     <Side_component_fixed/>
     </Col>
     </Row>
     <Expand_onclick_div/>
     {/* <Navbar1/> */}

    {/* <Fixed_2/> */}
    {/* <Fixed_3/> */}

    </div>
  );
}

export default App;
